    >
      <h3 className='ui header'> Home </h3>
      <p>
        Lorem ipsum dolor sit amet consectetur adipisicing elit. Assumenda odio
        dolorum eveniet esse fugiat, eligendi earum vel qui.
      </p>
    </div>
  )
}

export default Home
